import React, { Component } from 'react';
import Aux from '../../../hoc/Aux/Aux';
import Match from '../../Match/Match';
import axios from '../../../axios-matches';

class CompletedMatches extends Component {

    state = {
        matchResults: []
    }

    componentDidMount() {
        this.fetchMatcheResults();
    }

    fetchMatcheResults() {
        let obj = {
            "apikey": "tTzabHsmnIPgA6CNdPwKGRCpduW2"
        }
        axios.post('cricket/', obj)
            .then(res => {
                console.log(res)
                this.setState({ matchResults: res ? res.data ? res.data.data : []:[] })
            })
            .catch(err => console.log(err));
    }

    fetchMatchDetail =(id)=>{
        this.props.history.push('/' + id)
    }

    render() {
        let match = 'No matches available';
        let matchData; 
        if (this.state.matchResults && this.state.matchResults.length > 1 ) {
             matchData = this.state.matchResults;
            match = matchData.map((match, index) => {
                return (
                    <div  key={index}>
                        <Match
                            date=''
                            name=''
                            title={match.title}
                            dateTimeGmt=''
                            matchStarted='true'
                            teamOne=''
                            teamTwo=''
                            toss='No Toss'
                            type=''
                            uniqueId={match.unique_id}
                            clicked={()=>this.fetchMatchDetail(match.unique_id)}
                        />
                    </div>)
            })
        }
        return (
            <Aux>
                {match}
            </Aux>
        )
    }
}


export default CompletedMatches;
